const Login = (props) => {
  return (
    <div className='login-container'>
        <h1 className='welcome-message'>Welcome to Decentralized Voting App</h1>
        <button className='login-button' onClick={props.connectWallet}>Login Metamask</button>
    </div>
  )
}

export default Login;
